$$.control.registerControl("rootPage",{deps:["breizbot.apps","breizbot.users"],template:'<div bn-control="breizbot.apps" \n\tbn-data="{apps}" \n\tbn-event="appclick: onAppClick"\n\tstyle="height: 100%">\n\t\t\n\t</div>',init:function(t,e,n){const o=$$.viewController(t,{data:{apps:[]},events:{onAppClick:function(t,e){console.log("onAppClick",e),$$.ui.showConfirm({title:e.props.title,content:"Description:",okText:e.activated?"Desactivate":"Activate"},function(){n.activateApp(e.appName,!e.activated).then(()=>{e.activated=!e.activated})})}}});e.listAll().then(t=>{console.log("apps",t),o.setData({apps:t})})}});